  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:18.306212\",\n\t\"name\": \"desoto-national-wildlife-refuge-narrative-report-calendar-year-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Desoto
  National Wildlife Refuge outlines Refuge accomplishments during the 1985 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the master plan, management
  planning, compliance with environmental and cultural resource mandates, and research
  and investigations. Refuge administration is outlined; information about personnel,
  youth programs, manpower programs, volunteer programs, funding, and safety is given.
  Habitat management is also covered; subjects include wetlands, forests, croplands,
  grasslands, grazing, haying, fire management, and pest control. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, and fisheries resources.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, wildlife observation, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, major maintenance, equipment
  replacement, and energy conservation. Cooperative programs and items of interest
  are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
